import React from 'react'
import '../../src/editor.css';
import { useState, useEffect } from "react";
function Editor(menuData) {
const [path,setPath] = useState('');
  useEffect(() => {
    var filename = menuData.menuData.content.replace(/^.*\\/, "");
    setPath(filename);
  }, [menuData]);
  

  return (
    <div className="editor">
     <h1>{menuData.menuData.title}</h1>
     {console.log(menuData)}
     {console.log(menuData.menuData.content)}
     
     <div className="content">
       {menuData.menuData.type === 'img' || menuData.menuData.type === 'video'?
       <img src={path}></img>
       :<p>{menuData.menuData.content}</p>
       }
     </div>
    </div>
  );
}

export default Editor;
